import React from 'react';

function Header() {
    return (
        <>
            <div className="header">
                <div className="logo">
                    <img src="" alt="" />
                </div>
                <div className="nav-links"></div>
                <div className="icons"></div>
            </div>
        </>
    )
}

export default Header;
